import React from 'react';
import { useLocation } from 'react-router-dom';

const MyVillas = () => {
  const location = useLocation();
  const { villas } = location.state || [];

  return (
    <div>
      <h2>내 빌라 목록</h2>
      {villas.length > 0 ? (
        <ul>
          {villas.map(villa => (
            <li key={villa._id}>
              <h3>{villa.villaName}</h3>
              <p>{villa.address}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>등록된 빌라가 없습니다.</p>
      )}
    </div>
  );
};

export default MyVillas;
